%angular

<center>
    <form class="form-inline">
        <div class="form-group">          
            <input type="text" class="form-control" id="yearid" placeholder="Year" ng-model="year"></input>       
        </div>   
        <div class="form-group">
            <input type="text" class="form-control" id="monthid" placeholder="Month" ng-model="month"></input>
        </div>  
        <div class="form-group">
            <input type="text" class="form-control" id="dayid" placeholder="Day" ng-model="day"></input>
        </div>
        <button type="submit" class="btn btn-primary" ng-click="
            z.angularBind('year',year,'20181210-012620_1162286361');
            z.angularBind('month',month,'20181210-012620_1162286361');
            z.angularBind('day',day,'20181210-012620_1162286361');
            z.angularBind('year',year,'20181211-081206_1714481784');
            z.angularBind('month',month,'20181211-081206_1714481784');
            z.angularBind('day',day,'20181211-081206_1714481784');
            z.angularBind('year',year,'20181211-081203_972175002');
            z.angularBind('month',month,'20181211-081203_972175002');
            z.angularBind('day',day,'20181211-081203_972175002');
            z.runParagraph('20181210-012620_1162286361');
            z.runParagraph('20181211-081206_1714481784');
            z.runParagraph('20181211-081203_972175002');
        ">submit</button>
    </form>
</center>

%sql

select * 
from mword 
where year(date) = ${year}
and month(date) = ${month}
and day(date) = ${day}

%sql

select * 
from dword 
where year(date) = ${year}
and month(date) = ${month}
and day(date) = ${day}

%sql

select * 
from uword 
where year(date) = ${year}
and month(date) = ${month}
and day(date) = ${day}
